import { Box } from "@mui/material";
import { Suspense } from "react";
import { Outlet } from "react-router-dom";
import { StructureSelect } from "../components/MainLayout/StructureSelect/StructureSelect";

const Digitalization = () => {
  return (
    <Box sx={{ w: "100%" }}>
      <StructureSelect />
      <Suspense>
        <Outlet />
      </Suspense>
    </Box>
  );
};

export default Digitalization;
